import React, { Component } from 'react';
import './Person.css';

class Person extends Component {
    render() {
        return (
            <div className="person-wrapper">
                <h1>My name is {this.props.name} and I'm {this.props.age} years old</h1>
            </div>
        );
    }
}

export default Person;
